import React from 'react';
import './Experience.css';

const Experience = () => {
    return (
        <div className="experience">
            <h2>Experience</h2>
            <div className="experience-item">
                <h3>Cby Services Pvt Ltd</h3>
                <p>Cloud Engineer</p>
                <p>April 2023 - Present</p>
                <p>2 years of experience in cloud engineering, focusing on cloud solutions and infrastructure management.</p>
            </div>
        </div>
    );
};

export default Experience;
